  input: TEXT,"F3XA","","This amendment is in response to the Commission's letter
    dated December 23, 2005.    Payments for  'Facility Rental,' 'Kaine Tent Rental'
    and 'Food and Beverage' on Schedules B and H4 did not refer to any candidate for
    federal office.  Payments for 'Telephones' were for office lines used during the
    Coordinated Campaign and are therefore Administrative Expenses.  They did not
    benefit or refer to any candidate for federal office.  Payments for 'Election
    Night Stipend' were not wages and were not made on behalf of or refer to any candidate
    for federal office. The transfers to the Committee's Non-Federal Account reported
    on Schedule B for Line 29 as ''Transfers to Non-Federal Account' to the 'Democratic
    Party of Virginia' were for cash flow purposes and no allocable expenses were
    paid from this Non-Federal Account. Payments for 'Compliance Consulting,' and
    'Legal Fees' were made for non-employee compensation.  Disbursements for 'October
    Cell Phone' 'October Cell Phone Stipend' and 'September Cell Phone' were stipends
    for cell phone expenses and are paid to the individuals on a predetermined scale.
    These payments are not reimbursements for a specific payment to a vendor, but
    were made to offset the costs incurred by the individual for cellular phone usage.
